import React from 'react';
import { useDispatch,useSelector } from 'react-redux';

function App() {
  const dispatch = useDispatch()
  const like = useSelector((state)=>state.like.like)

  const addLike=() =>{
    dispatch({type: 'addLike',number:1})
  }

  const removeLike=() =>{
    dispatch({type: 'removeLike',number:1})
  }


  return (
    <div className="App">
      <div>{like}</div>
      <input type="button" onClick={()=>addLike()} value='лайк'/>
      <input type="button" onClick={()=>removeLike()}value='дизлайк'/>
    </div>
  );
}

export default App;
